import React from 'react';
import { Link } from 'react-router-dom';
import './Users.css';

const User = ({ user }) => {
  return (
    <Link to={`/users/${user._id}`} className='user-profile-link'>
      <div className='user'>
        <h3>{user.name.charAt(0).toUpperCase()}</h3>
        <h5>{user.name}</h5>
      </div>
    </Link>
  );
};

export default User;
